package com.rdc.ruan.zzia.Main.AsyncTask;

import android.os.AsyncTask;

import com.rdc.ruan.zzia.Main.HttpUtils.HttpUtil;
import com.rdc.ruan.zzia.Main.HttpUtils.MyJsoup;
import com.rdc.ruan.zzia.Main.Interface.CallbackListener;

import org.apache.http.impl.client.DefaultHttpClient;
import org.apache.http.message.BasicNameValuePair;

import java.util.ArrayList;
import java.util.List;

/**
 * Created by Ruan on 2015/3/18.
 */
public class ClassTablePostTask extends AsyncTask {
    String baseurl,year,term;
    String viewstate;
    List<BasicNameValuePair> pairs=new ArrayList<>();
    CallbackListener callbackListener;
    public void setCallbackListener(CallbackListener callbackListener){
        this.callbackListener=callbackListener;
    }
    public ClassTablePostTask(String baseurl, String year, String term) {
        super();
        this.baseurl=baseurl;
        this.term=term;
        this.year=year;
    }

    @Override
    protected Object doInBackground(Object[] objects) {
        DefaultHttpClient client=new DefaultHttpClient();
        viewstate="";
        pairs.add(new BasicNameValuePair("ddlXN",year));
        pairs.add(new BasicNameValuePair("ddlXQ",term));
        pairs.add(new BasicNameValuePair("__VIEWSTATE",viewstate));
        pairs.add(new BasicNameValuePair("__EVENTTARGET","ddlXQ"));
        pairs.add(new BasicNameValuePair("__VIEWSTATEGENERATOR","FDD5582C"));
        pairs.add(new BasicNameValuePair("__EVENTARGUMENT",""));
        String result="";
        try {
            result=HttpUtil.postUrl(baseurl,pairs,client, MyJsoup.getMainUrl());
        }catch (Exception e){
            e.printStackTrace();
        }
        System.out.println(result);
        return result;
    }

    @Override
    protected void onPreExecute() {
        super.onPreExecute();
    }

    @Override
    protected void onProgressUpdate(Object[] values) {
        super.onProgressUpdate(values);
    }

    @Override
    protected void onPostExecute(Object o) {
        super.onPostExecute(o);
        callbackListener.Return(o);
    }
}
